import React from 'react';
// components
import Headerwhite from './layouts/Headerwhite';
import Footer from './layouts/Footer';
// FontAwesome
import './FontAwesome';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'

function HomePage(){
    return(
        <div>
            <Headerwhite/>
            <div className="home">
                <div className="home-slider">    
                    <ul className="home-slider-dots">
                        <li className="home-slider-item">.</li>
                        <li className="home-slider-item">.</li>
                        <li className="home-slider-item">.</li>
                    </ul>
                    <div className="home-slider-main">
                        <div className="home-slider-item">
                            <img src={process.env.PUBLIC_URL +'/slider_2.jpg'} height="100%" width="100%" alt="slider_item_1" />
                        </div>
                        <div className="home-slider-item" >
                            <img src={process.env.PUBLIC_URL +'/slider_1.jpg'} height="100%" width="100%"alt="slider_item_1" />
                        </div>
                        <div className="home-slider-item" >
                            <img src={process.env.PUBLIC_URL +'/slider_1.jpg'} height="100%" width="100%" alt="slider_item_1" />
                        </div>
                    </div>
                    <FontAwesomeIcon icon="angle-left" className="home-slider-prev"/>
                    <FontAwesomeIcon icon="angle-right" className="home-slider-next"/>

                </div>
            </div>
            <Footer/>       
        </div>
    )
};
export default HomePage;
